import React from 'react';
import { FaFacebookMessenger, FaPhoneAlt, FaZalo } from 'react-icons/fa';

export default function ContactButtons() {
  return (
    <div className="fixed bottom-6 left-6 flex flex-col gap-3">
      <a href="https://m.me/yourpage" target="_blank" rel="noreferrer" className="bg-blue-500 text-white p-3 rounded-full shadow-lg"><FaFacebookMessenger /></a>
      <a href="https://zalo.me/yourid" target="_blank" rel="noreferrer" className="bg-sky-500 text-white p-3 rounded-full shadow-lg"><FaZalo /></a>
      <a href="tel:0123456789" className="bg-green-500 text-white p-3 rounded-full shadow-lg"><FaPhoneAlt /></a>
    </div>
  );
}
